from problems.p649 import Solution


def test_RD():
    sol = Solution()
    assert sol.predictPartyVictory('RD') == 'Radiant'


def test_RDD():
    sol = Solution()
    assert sol.predictPartyVictory('RDD') == 'Dire'


def test_RDRD():
    sol = Solution()
    assert sol.predictPartyVictory('RDRD') == 'Radiant'


def test_RDRDDD():
    sol = Solution()
    assert sol.predictPartyVictory('RDRDDD') == 'Dire'


def test_data():
    sol = Solution()
    data = ""
    assert sol.predictPartyVictory(data) == 'Radiant'
